import  img1 from  '../src/images/1.jpg';

import  img2 from '../src/images/3.jfif';

import  img3 from '../src/images/4.jpg';

import  img4 from '../src/images/2.jpg';

import  img5 from '../src/images/5.jfif';

import  img6 from '../src/images/4.jpg';

const Sdata = [
    {
        imgsrc: img1,
        imgname: "Web Developer"
    },
    {
        imgsrc: img2,
        imgname: "Web Designer"
    },
    {
        imgsrc: img3,
        imgname: "Full Stack Developer"
    },
    {
        imgsrc: img4,
        imgname: "Web Develope"
    },
    {
        imgsrc: img5,
        imgname: "Web Develope"
    },
    {
        imgsrc: img6,
        imgname: "Web Develope"
    }

];

export default Sdata;
